import { Line } from 'react-chartjs-2';
import React from 'react';

const randomColor = require('random-color');
let color1 = randomColor(0.99, 0.99);
let color2 = randomColor(0.99, 0.99);

const state = {
    labels: ['January', 'February', 'March',
             'April', 'May'],
    datasets: [
      {
        label: 'Rainfall',
        data: [0, 59, 80, 81, 56],
        lineTension: 0.1,
        fill: false,
		backgroundColor: color1.rgbString(),
		borderColor: color1.rgbString(),
		pointBorderColor: color1.rgbString(),
		pointBackgroundColor: '#fff',
		pointBorderWidth: 2,
		pointHoverRadius: 9,
		pointHoverBackgroundColor: color1.rgbString(),
		pointHoverBorderColor: 'rgba(220,220,220,1)',
		pointHoverBorderWidth: 2,
		pointRadius: 4,
		pointHitRadius: 10,
      },
      {
        label: 'Test',
        data: [0, 15, 9, 40, 35],
        lineTension: 0.1,
        fill: false,
		backgroundColor: color2.rgbString(),
		borderColor: color2.rgbString(),
		pointBorderColor:color2.rgbString(),
		pointBackgroundColor: 'red',
		pointBorderWidth: 2,
		pointHoverRadius: 9,
		pointHoverBackgroundColor: color2.rgbString(),
		pointHoverBorderColor: 'rgba(220,220,220,1)',
		pointHoverBorderWidth: 2,
		pointRadius: 4,
		pointHitRadius: 10,
      }
    ]
  };

  interface ExpensesLineDiagramProps
  {
    padding?: number,
    paddingLeft?: number,
    paddingRight?: number,
    paddingBottom?: number,
    paddingTop?: number,
  }
  

  const ExpensesLineDiagram:React.FC<ExpensesLineDiagramProps> = () => {

    return(
        <div style={{padding:80}}>
            <Line data={state}
            width={400}
            options={{
                title:{
                    display:true,
                    text:'Average Rainfall per month',
                    fontSize:20
                },
                legend:{
                    display:true,
                    position:'right'
                }
            }}
            />
        </div>
    );
  }

  export default ExpensesLineDiagram;
